import { StyleSheet } from "react-native";

export const s = StyleSheet.create({
  app: {
    flex: 1,
    backgroundColor: "#F9F9F9",
    padding: 15,
  },
  header: {
    flex: 1,
  },
  body: {
    flex: 1,
  },
  footer: {
    height: 70,
  },
  cardItem: {
    marginBottom: 15,
  },
});
